import React from 'react';

const MatrixTable = () => {
  // Sample data representing class names and corresponding fees
  const classData = [
    {
      className: 'Class 1',
      fees: [5000, 6000, 7000] // Fees for different terms or months
    },
    {
      className: 'Class 2',
      fees: [5500, 6500, 7500]
    },
    {
      className: 'Class 3',
      fees: [6000, 7000, 8000]
    }
  ];

  return (
    <table border="1">
      <thead>
        <tr>
          <th>Class Name</th>
          <th>PK1</th>
          <th>PK2</th>
          <th>First</th>
          <th>Second</th>
          <th>Third</th>
          <th>Fourth</th>
          <th>Fifth</th>
          <th>Sixth</th>
          <th>Seventh</th>
          <th>Eight</th>
          <th>Ninth</th>





        </tr>
      </thead>
      <tbody>
        {classData.map((classItem, index) => (
          <tr key={index}>
            <td>{classItem.className}</td>
            {classItem.fees.map((fee, idx) => (
              <td key={idx}>{fee}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default MatrixTable;
